      " <p>Aplikasi Ruang Ortu by ASIA adalah aplikasi yang di buat untuk membantu orang tua guna melindungi anak-anak dan memberikan pengawasan agar anak-anak tetap aman saat online. Aplikasi Ruang Ortu by ASIA merupakan aplikasi yang dapat di gunakan sebagai monitoring &amp; kontrol anak untuk kontrol waktu layar, pelacakan lokasi, pengawasan waktu penggunaan aplikasi, batasi penggunaan aplikasi, pantau penggunaan telepon, kontrol situs web. Melalui aplikasi Ruang Ortu by ASIA, Anda dapat melihat statistik lama penggunaan gadget anak, memblokir aplikasi, mengatur batas waktu aplikasi harian, membatasi waktu layar, memblokir konten yang tidak pantas, memantau panggilan, dan lain lain. Keunikan dari aplikasi Ruang Ortu by ASIA yaitu aplikasi tidak hanya menyediakan fitur parental control saja, tetapi menghadirkan konten-konten parenting, edukasi, religi dan lainnya sehingga orang tua dan anak dapat memanfaatkan penggunaan teknologi untuk mendapatkan konten-konten yang positif bagi anak dan orang tua. Selain itu terdapat pula fitur “Panic Button” dimana Fitur ini membantu orangtua dalam melacak keberadaan anak jika anak dalam kondisi darurat. Anak dapat menekan tombol panik melalui aplikasi Ruang Ortu by ASIA dan Orang tua akan mendapatkan notifikasi panggilan berupa rekaman video dan lokasi terkini anak.<\/p>";
  a += "<p>atau<\/p>";
  a +=
      "<p>Pengalaman baru yang dikembangkan PT IDE DEF GHI adalah sebuah aplikasi Digital Parenting yang dinamakan “Ruang Ortu by ASIA” , yang memungkinkan para orangtua di era milenial saat ini, untuk dapat mengontrol&nbsp; dan mengawasi anak dalam penggunaan teknologi khususnya gadget dari konten-konten negatif yang semakin mudah diakses.<\/p>";
