      " <div class=\"wpb_text_column wpb_content_element vc_custom_1649226793113\">";
  a += " <div class=wpb_wrapper>";
  a +=
      " <p><span style=font-weight:400>Aplikasi Ruang Ortu by ASIA dapat di download melalui Google Playstore. <\/span><span style=font-weight:400>Setelah melakukan install, ada beberapa tahapan untuk register di dalam aplikasi Ruang Ortu by ASIA, berikut tahapannya:<\/span><\/p>";
