      " <div class=\"wpb_accordion_content ui-accordion-content vc_clearfix ui-corner-bottom ui-helper-reset ui-widget-content\" id=ui-id-12 aria-labelledby=ui-id-11 role=tabpanel aria-hidden=true style>";
  a += " ";
  a += " <div class=\"wpb_text_column wpb_content_element\">";
  a += " <div class=wpb_wrapper>";
  a +=
      " <p><span style=font-weight:400>Anda dapat mengetahui aplikasi yang diinstall oleh anak dan statistik penggunaannya, berikut tahapan untuk melihat penggunaan aplikasi pada perangkat anak:<\/span><\/p>";
  a +=
      "<p><span style=font-weight:400>Tahap 1 : Di Halaman Utama, geser keatas pada menu profil anak, lalu klik icon <img loading=lazy class=\"alignnone wp-image-2609\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"50\" height=\"44\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=23 height=20 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-15) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\"><\/span><\/p>";
  a +=
      "<p><span style=font-weight:400>&nbsp; <img loading=lazy class=\"size-medium wp-image-2606 aligncenter\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"300\" height=\"163\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=300 height=163 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-16) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\"><\/span><\/p>";
  a += "<p>&nbsp;<\/p>";
  a +=
      "<p><span style=font-weight:400>Tahap 2 : Klik <\/span><b>“Detil Penggunaan”<\/b><span style=font-weight:400> untuk melihat daftar aplikasi apa saja yang di install oleh anak.<\/span><\/p>";
  a +=
      "<p><img loading=lazy class=\"size-medium wp-image-2607 aligncenter\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"300\" height=\"238\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=300 height=238 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-17) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\"><\/p>";
