  a += " <div class=\"wpb_accordion_section group\">";
  a +=
      " <h3 class=\"wpb_accordion_header ui-accordion-header ui-corner-top ui-accordion-header-collapsed ui-corner-all ui-state-default ui-accordion-icons\" role=tab id=ui-id-25 aria-controls=ui-id-26 aria-selected=false aria-expanded=false tabindex=-1><span class=\"ui-accordion-header-icon ui-icon ui-icon-triangle-1-e\"><\/span><a href=#apakah-aplikasi-ruang-ortu-harus-dipasang-di-perangkat-orangtua-perangkat-anak><span>Apakah aplikasi Ruang Ortu harus dipasang di perangkat orangtua &amp; perangkat anak?<\/span><\/a><\/h3>";
  a +=
      " <div class=\"wpb_accordion_content ui-accordion-content vc_clearfix ui-corner-bottom ui-helper-reset ui-widget-content\" id=ui-id-26 aria-labelledby=ui-id-25 role=tabpanel aria-hidden=true style>";
  a += " ";
  a +=
      " <div class=\"wpb_text_column wpb_content_element vc_custom_1647012424619\">";
  a += " <div class=wpb_wrapper>";
  a +=
      " <p>Ya aplikasi Ruang Ortu by ASIA harus sama-sama terinstall di perangkat anak dan orangtua.<\/p>";
  a +=
      "<p>Aplikasi Ruang Ortu by ASIA tidak dipisahkan menjadi dua aplikasi yang berbeda untuk aplikasi orangtua dan aplikasi anak.<\/p>";
  a +=
      "<p>Saat anda masuk kedalam aplikasi Ruang Ortu by ASIA menggunakan akun sebagai orangtua, anda akan diberikan fungsi untuk monitoring dan mengendalikan ponsel anak anda.<\/p>";
  a +=
      "<p>Tetapi Saat anda masuk menggunakan akun sebagai anak, fungsi yang diberikan hanya berisi program dan konten yang dibuat oleh orangtua serta layanan tombol darurat untuk mengirimkan notifikasi dan lokasi anak ke ponsel orangtua jika anak dalam kondisi darurat.<\/p>";
  a += " <\/div>";
  a += " <\/div>";
  a += " <\/div>";
  a += " <\/div>";
  a += " <div class=\"wpb_accordion_section group\">";
  a +=
      " <h3 class=\"wpb_accordion_header ui-accordion-header ui-corner-top ui-accordion-header-collapsed ui-corner-all ui-state-default ui-accordion-icons\" role=tab id=ui-id-27 aria-controls=ui-id-28 aria-selected=false aria-expanded=false tabindex=-1><span class=\"ui-accordion-header-icon ui-icon ui-icon-triangle-1-e\"><\/span><a href=#saya-khawatir-anak-saya-menelepon-ke-nomor-telepon-yang-berbau-sara-pornografy-seperti-layanan-premium-call-phone-sex-apakah-saya-dapat-memblokir-nomor-tersebut><span>Saya khawatir anak saya menelepon ke nomor telepon yang berbau sara &amp; pornografy seperti layanan premium call &amp; phone sex, apakah saya dapat memblokir nomor tersebut?<\/span><\/a><\/h3>";
  a +=
      " <div class=\"wpb_accordion_content ui-accordion-content vc_clearfix ui-corner-bottom ui-helper-reset ui-widget-content\" id=ui-id-28 aria-labelledby=ui-id-27 role=tabpanel aria-hidden=true style>";
  a += " ";
  a +=
      " <div class=\"wpb_text_column wpb_content_element vc_custom_1647012449932\">";
  a += " <div class=wpb_wrapper>";
  a +=
      " <p><span style=font-weight:400>Aplikasi Ruang Ortu by ASIA memiliki fitur pantau panggilan, dimana orangtua dapat memantau nomor telepon yang mengandung unsur negatif, sehingga setiap panggilan masuk maupun panggilan keluar dari nomor telepon yang dipantau, orangtua akan menerima notifikasi pemberitahuan.<\/span><\/p>";
  a +=
      "<p><span style=font-weight:400>Cara memantau nomor telepon:<\/span><\/p>";
  a +=
      "<p><span style=font-weight:400>Tahap 1 : Pada Halaman Utama, geser ke atas pada menu profil anak, lalu klik icon <img loading=lazy class=\"alignnone wp-image-2609\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"50\" height=\"44\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=23 height=20 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-15) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\">&nbsp;<\/span><\/p>";
  a +=
      "<p><span style=font-weight:400><img loading=lazy class=\"size-medium wp-image-2606 aligncenter\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"300\" height=\"163\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=300 height=163 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-16) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\">&nbsp;&nbsp;<\/span><\/p>";
  a +=
