  a += " <div class=\"wpb_accordion_section group\">";
  a +=
      " <h3 class=\"wpb_accordion_header ui-accordion-header ui-corner-top ui-accordion-header-collapsed ui-corner-all ui-state-default ui-accordion-icons\" role=tab id=ui-id-29 aria-controls=ui-id-30 aria-selected=false aria-expanded=false tabindex=-1><span class=\"ui-accordion-header-icon ui-icon ui-icon-triangle-1-e\"><\/span><a href=#apakah-saya-bisa-membuat-jadwal-bermain-gadget-dalam-satu-minggu-kepada-anak><span>Apakah saya bisa membuat jadwal bermain gadget dalam satu minggu kepada anak?<\/span><\/a><\/h3>";
  a +=
      " <div class=\"wpb_accordion_content ui-accordion-content vc_clearfix ui-corner-bottom ui-helper-reset ui-widget-content\" id=ui-id-30 aria-labelledby=ui-id-29 role=tabpanel aria-hidden=true style>";
  a += " ";
  a +=
      " <div class=\"wpb_text_column wpb_content_element vc_custom_1647012510096\">";
  a += " <div class=wpb_wrapper>";
  a +=
      " <p><span style=font-weight:400>Aplikasi Ruang Ortu by ASIA memiliki fitur “JADWAL PENGGUNAAN, dimana orang tua dapat membuat jadwal untuk anak dalam menggunakan ponsel dalam satu minggu, sehingga anak dapat lebih disiplin dalam menggunakan ponsel mereka.<\/span><\/p>";
  a += "<p><span style=font-weight:400>Caranya :&nbsp;<\/span><\/p>";
  a +=
      "<p><span style=font-weight:400>Tahap 1 : Pada Halaman Utama, geser ke atas pada menu profil anak, lalu klik icon <img loading=lazy class=\"alignnone wp-image-2609\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"50\" height=\"44\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=23 height=20 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-15) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\"><\/span><\/p>";
  a +=
      "<p><img loading=lazy class=\"size-medium wp-image-2606 aligncenter\" src='data:image\/svg+xml,<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"300\" height=\"163\"><rect fill-opacity=\"0\"\/><\/svg>' alt width=300 height=163 style=\"background-blend-mode:normal !important;background-clip:content-box !important;background-position:50% 50% !important;background-color:rgba(0,0,0,0) !important;background-image:var(--sf-img-16) !important;background-size:100% 100% !important;background-origin:content-box !important;background-repeat:no-repeat !important\"><\/p>";
  a +=
      "<p><span style=font-weight:400>Tahap 2 : Cari &amp; Pilih menu <\/span><b>“SET JADWAL PENGGUNAAN”<\/b><span style=font-weight:400> pada menu setting.<\/span><\/p>";
