  a +=
      " <p><span style=font-weight:400>Jika ponsel anak anda hilang, anda dapat menghapus akun anak anda melalui aplikasi Ruang Ortu by ASIA di ponsel orangtua atau anda dapat memindahkan akun anak anda ke ponsel yang baru dengan melakukan login sebagai anak di perangkat yang baru.<\/span><\/p>";
