String ppHtml() {
  String strVar = "";
  strVar += "<!DOCTYPE html>";
  strVar +=
      "<!-- saved from url=(0056)https:\/\/asia.ruangortu.id\/toc\/privacy_policy_bahasa.html -->";
  strVar +=
      "<html><head><meta http-equiv=\"Content-Type\" content=\"text\/html; charset=windows-1252\">";
  strVar += "  <title>Privacy and Policy<\/title>";
  strVar +=
      "  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, user-scalable=no\">";
  strVar += "<\/head>";
  strVar += "<body style=\"padding: 20px\">";
  strVar += "<h2 style=\"color: #2e6c80;\">Privacy and Policy<\/h2>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Terakhir diperbarui: 20 September 2020<\/span><\/p>";
  strVar += "<p><strong>&nbsp;<\/strong><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Kebijakan Privasi ini menjelaskan kebijakan dan prosedur Kami tentang pengumpulan, penggunaan, dan pengungkapan informasi Anda saat Anda menggunakan Layanan dan memberitahu Anda tentang hak privasi Anda dan bagaimana hukum melindungi Anda.<\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Kami menggunakan data Pribadi Anda untuk menyediakan dan meningkatkan Layanan. Dengan menggunakan Layanan, Anda menyetujui pengumpulan dan penggunaan informasi sesuai dengan Kebijakan Privasi ini.<\/span><\/p>";
  strVar += "<p><strong>&nbsp;<\/strong><\/p>";
  strVar += "<p><strong>Interpretasi dan Definisi<\/strong><\/p>";
  strVar += "<p><strong>Penafsiran<\/strong><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Kata-kata yang huruf awalnya dikapitalisasi memiliki arti yang ditentukan dalam kondisi berikut. Definisi berikut harus memiliki arti yang sama terlepas dari apakah mereka muncul dalam bentuk tunggal atau jamak.<\/span><\/p>";
  strVar += "<p>&nbsp;<\/p>";
  strVar += "<p><strong>Definisi<\/strong><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Untuk tujuan Kebijakan Privasi ini:<\/span><\/p>";
  strVar += "<ul>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Anda berarti individu yang mengakses, menggunakan, atau memanfaatkan layanan Aplikasi Ruang ORTU by ASIA ( termasuk perusahaan, atau badan hukum lainnya atas nama individu tersebut)&nbsp;<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Kami berarti Perusahaan penggembang Aplikasi Ruang ORTU by ASIA mengacu pada PT. Defghi Global beralamat di, Sentra Niaga Blok A No. 8, Greenlake City, Jakarta Barat<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Afiliasi berarti suatu entitas yang mengendalikan, dikendalikan oleh, atau berada di bawah kendali bersama dengan suatu pihak, di mana \"pengendalian\" berarti kepemilikan 50% atau lebih dari saham, kepentingan ekuitas, atau sekuritas lain yang berhak memberikan suara untuk pemilihan direktur atau otoritas pengelola lainnya .<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Aplikasi berarti program perangkat lunak yang disediakan oleh Perusahaan yang diunduh oleh Anda pada perangkat elektronik apa pun, bernama RUANG ORTU<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Cookie adalah file kecil yang ditempatkan di komputer Anda, perangkat seluler, atau perangkat lain apa pun oleh situs web, yang berisi detail riwayat penelusuran Anda di situs web tersebut di antara banyak kegunaannya.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Negara mengacu pada: Indonesia<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Perangkat berarti perangkat apa pun yang dapat mengakses Layanan seperti komputer, ponsel, atau tablet digital.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Data Pribadi adalah setiap informasi yang berkaitan dengan individu yang teridentifikasi atau dapat diidentifikasi.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Layanan mengacu pada Aplikasi atau Situs Web atau keduanya.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyedia Layanan berarti setiap orang atau badan hukum yang memproses data atas nama Perusahaan. Ini mengacu pada perusahaan atau individu pihak ketiga yang dipekerjakan oleh Perusahaan untuk memfasilitasi Layanan, untuk menyediakan Layanan atas nama Perusahaan, untuk melakukan layanan yang terkait dengan Layanan atau untuk membantu Perusahaan dalam menganalisis bagaimana Layanan digunakan.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Layanan Media Sosial pihak ketiga mengacu pada situs web apa pun atau situs web jejaring sosial apa pun yang melaluinya Pengguna dapat masuk atau membuat akun untuk menggunakan Layanan.<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Data Email mengacu pada email yang dikumpulkan secara otomatis, dikumpulkan menggunakan Google API&nbsp;<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Data Penggunaan mengacu pada data yang dikumpulkan secara otomatis, baik yang dihasilkan oleh penggunaan Layanan atau dari infrastruktur Layanan itu sendiri (misalnya, durasi kunjungan halaman).<\/span><\/li>";
  strVar +=
      "  <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Website mengacu pada <strong>ruangortu.id<\/strong>, dapat diakses dari <strong>https:\/\/ruangortu.id<\/strong><\/span><\/li>";
  strVar += "<\/ul>";
  strVar += "<p>&nbsp;<\/p>";
  strVar +=
      "<p><strong>Bagaimana Anda Menggunakan Aplikasi Ruang ORTU by ASIA<\/strong><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\"><strong>&nbsp;<\/strong><\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Kami saat ini memberi Anda lisensi non-eksklusif, tidak dapat dipindahtangankan, dan dapat dibatalkan untuk menggunakan salinan kode yang dikompilasi dari Perangkat Lunak Seluler untuk akun yang dimiliki atau disewa hanya oleh Anda, untuk penggunaan pribadi Anda.<\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Anda tidak boleh: (i) memodifikasi, membongkar, mengkompilasi, atau merekayasa balik Perangkat Lunak Seluler, kecuali sejauh pembatasan tersebut secara tegas dilarang oleh hukum; (ii) menyewakan, menyewakan, meminjamkan, menjual kembali, mensublisensikan, mendistribusikan, atau mentransfer Perangkat Lunak Seluler ke pihak ketiga mana pun atau menggunakan Perangkat Lunak Seluler untuk menyediakan pembagian waktu atau layanan serupa untuk pihak ketiga mana pun; (iii) membuat salinan apa pun dari Perangkat Lunak Seluler; (iv) menghapus, menghindari, menonaktifkan, merusak, atau mengganggu fitur terkait keamanan Perangkat Lunak Seluler, fitur yang mencegah atau membatasi penggunaan atau penyalinan konten apa pun yang dapat diakses melalui Perangkat Lunak Seluler, atau fitur yang memberlakukan pembatasan penggunaan Seluler Perangkat lunak; atau (v) menghapus pemberitahuan hak cipta dan hak kepemilikan lainnya pada Perangkat Lunak Seluler.<\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\"><strong>&nbsp;<\/strong><\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\">Anda mengakui bahwa kami dapat dari waktu ke waktu mengeluarkan versi perangkat lunak seluler yang ditingkatkan, dan dapat secara otomatis meningkatkan versi perangkat lunak seluler yang Anda gunakan pada perangkat seluler Anda. Anda menyetujui peningkatan otomatis tersebut pada perangkat seluler Anda dan setuju bahwa syarat dan ketentuan Perjanjian ini akan berlaku untuk semua peningkatan tersebut. Kode pihak ketiga apa pun yang dapat digabungkan dalam perangkat lunak seluler dicakup oleh sumber terbuka atau lisensi pihak ketiga EULA yang berlaku, jika ada, yang mengizinkan penggunaan kode tersebut. Pemberian lisensi sebelumnya bukanlah penjualan Perangkat Lunak Seluler atau salinannya, dan kami atau mitra atau pemasok pihak ketiga kami mempertahankan semua hak kepemilikan, dan kepentingan dalam Perangkat Lunak Seluler (dan setiap salinannya). Segala upaya oleh Anda untuk mengalihkan hak, tugas, atau kewajiban apa pun berdasarkan Perjanjian ini, kecuali sebagaimana ditentukan secara tegas dalam Perjanjian ini, tidak berlaku. Kami memiliki semua hak yang tidak diberikan secara tegas berdasarkan Perjanjian ini.<\/span><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\"><strong>&nbsp;<\/strong><\/span><\/p>";
  strVar +=
      "<p><strong>Bagaimana Kami Mengumpulkan Dan Menggunakan Informasi<\/strong><\/p>";
  strVar +=
      "<p><span style=\"font-weight: 400;\"><strong>&nbsp;<\/strong><\/span><\/p>";
  strVar += "<p><strong>Kebijakan Privasi kami menjelaskan:<\/strong><\/p>";
  strVar += "<ul>";
  strVar +=
