      "  <li style=\"list-style-type:lower-roman\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Penyimpanan USB: Ruang ORTU akan menggunakan sebagian memori internal pada perangkat ini untuk menjalankan fungsinya dengan baik.&nbsp;<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<ol start=\"5\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Pembatasan Tanggung Jawab DEFGHI<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a +=
      "<p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">DEFGHI dibebaskan dari tanggung jawab atas pembayaran kompensasi atau kerugian yang telah ditanggung oleh PELANGGAN, baik kerugian langsung maupun tidak langsung sebagai akibat dari berfungsinya atau tidak berfungsinya layanan Aplikasi Ruang ORTU by ASIA, karena :<\/span><\/span><\/span><\/p>";
  a += "";
  a += "<ol style=\"margin-left:40px\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Gangguan layanan Aplikasi Ruang ORTU by ASIA akibat kesalahan PELANGGAN.<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Perubahan jaringan layanan dan \/atau jaringan akses dan\/atau konfigurasi teknis layanan Aplikasi Ruang ORTU by ASIA DEFGHI berdasarkan ketentuan butir 3.2.1.<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Kerusakan akibat peristiwa \/ kejadian diluar batas kendali normal DEFGHI (Force Majeure).<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<p style=\"margin-left:96px\">&nbsp;<\/p>";
  a += "";
  a += "<ol start=\"6\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Sanksi<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<ol style=\"margin-left:40px\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Pelanggaran terhadap ketentuan butir 2.3.2 dan 2.3.3 dikenakan sanksi pencabutan pemutusan layanan Aplikasi Ruang ORTU by ASIA.<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Pelanggaran terhadap ketentuan butir 2.1.3 dikenakan sanksi dihilangkannya layanan-layanan aplikasi Aplikasi Ruang ORTU by ASIA kepada PENGGUNA .<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">PELANGGAN dengan ini memahami, mengetahui dan menyatakan bahwa ketentuan dalam butir 5.1 sampai dengan butir 5.2 merupakan pemberitahuan\/ informasi tentang kemungkinan dikenakannya sanksi tersebut, oleh karena itu tidak ada kewajiban bagi DEFGHI untuk memberitahukan lebih dahulu kepada PELANGGAN atas pengenaan sanksi dimaksud.<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<p style=\"margin-left:96px\">&nbsp;<\/p>";
  a += "";
  a += "<ol start=\"7\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Force<\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\"> Majeure<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<ol style=\"margin-left:40px\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Tidak dilaksanakannya sebagian atau seluruh ketentuan kontrak ini oleh PELANGGAN atau DEFGHI tidak termasuk sebagai pelanggaran atas kontrak jika hal tersebut disebabkan oleh keadaan force majeure (keadaan memaksa).<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Yang termasuk force majeure adalah kejadian-kejadian yang tidak dapat diduga yang berdampak luas serta tidak dapat diatasi oleh pihak yang mengalaminya atau pihak lainnya dan \/atau diumumkan oleh pemerintah setempat, termasuk peristiwa-peristiwa bencana alam, wabah penyakit, huru hara, perang, kebakaran, sabotase, pemogokan umum, putus aliran listrik umum\/ PLN.<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Seluruh kerugian yang dialami oleh PELANGGAN atau DEFGHI sebagai akibat dari keadaan force majeure tidak menjadi tanggung jawab pihak lainnya.<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<p style=\"margin-left:96px\">&nbsp;<\/p>";
  a += "";
  a += "<ol start=\"8\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Ketentuan<\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\"> yang dipisahkan (Severability)<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a +=
      "<p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Apabila oleh suatu sebab terdapat sebagian dari ketentuan dalam kontrak ini dibatalkan oleh Hakim atau menjadi batal demi hukum maka ketentuan tersebut tidak membatalkan atas mempengaruhi ketentuan selebihnya.<\/span><\/span><\/span><\/p>";
  a += "";
  a += "<ol>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Pengakhiran Kontrak<\/span><\/span><\/span>";
  a += "";
  a += "    <ol>";
  a +=
      "      <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Kontrak ini dapat diakhiri secara sepihak oleh DEFGHI, karena sanksi berdasarkan ketentuan <\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">butir 5.1 dan \/atau <\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">butir 5.2 atau karena DEFGHI tidak mampu lagi menjadi penyelenggara layanan Aplikasi Ruang ORTU by ASIA di wilayah lokasi PELANGGAN.<\/span><\/span><\/span><\/li>";
  a +=
      "      <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">PELANGGAN dapat mengakhiri kontrak ini secara sepihak dengan memberitahukan kepada DEFGHI terlebih dahulu.<\/span><\/span><\/span><\/li>";
  a +=
      "      <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">DEFGHI dan PELANGGAN sepakat untuk mengesampingkan berlakunya ketentuan pasal 1266 KUH Perdata, sehingga pembatalan atau pemutusan kontrak dapat dilakukan oleh salah satu pihak jika wanprestasi, dan dinyatakan sah tanpa menunggu keputusan hakim.<\/span><\/span><\/span><\/li>";
  a += "    <\/ol>";
  a += "  <\/li>";
  a += "<\/ol>";
  a += "";
  a += "<p>&nbsp;<\/p>";
  a += "";
  a += "<ol start=\"9\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Penyelesaian<\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\"> Perselisihan<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<ol style=\"margin-left:40px\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Perselisihan yang menyangkut pelaksanaan dan \/atau penafsiran atas kontrak ini diselesaikan bersama oleh DEFGHI dan PELANGGAN secara musyawarah.<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Apabila penyelesaian secara musyawarah berdasarkan ketentuan butir 10.1 tidak tercapai maka DEFGHI dan PELANGGAN sepakat menyerahkan penyelesaiannya kepada Pengadilan Negeri (PN) \/ Badan Penyelesaian Sengketa Konsumen (BPSK) dengan domisili hukum di lokasi kantor DEFGHI setempat.<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<p style=\"margin-left:96px\">&nbsp;<\/p>";
  a += "";
  a += "<ol start=\"10\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Lain<\/span><\/span><\/span><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\"> &ndash; lain<\/span><\/span><\/span><\/li>";
  a += "<\/ol>";
  a += "";
  a += "<ul style=\"margin-left:40px\">";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Hal-hal yang belum cukup diatur dalam kontrak ini akan diatur lebih lanjut dalam brosur, buku, leaflet, katalog produk, pengumuman\/ pemberitahuan dan\/ atau dokumen lain yang diterbitkan secara resmi dari waktu ke waktu oleh DEFGHI<\/span><\/span><\/span><\/li>";
  a +=
      "  <li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">Kontrak ini berlaku sejak pelanggan mengklik setuju pada awal registrasi layanan Aplikasi Ruang ORTU by ASIA<\/span><\/span><\/span><\/li>";
