      "<p><span style=\"font-size:12pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">PELANGGAN sepenuhnya memahami, menerima, dan tunduk pada syarat dan ketentuan layanan Aplikasi Ruang ORTU by ASIA sebagaimana tertuang dalam kontrak ini.<\/span><\/span><\/span><\/p>";
